	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
	  89502,NULL,9914,631,1980,
	  "3.95 USD",36.000,NULL,"At least two printings exist both from 1980. According to Eisner's introduction to this volume 1st 6 weeks of dailies were written by Eisner with art by Lou Fine over Eisner layouts; rest of strips for the daily run through 1944 were by Jack Cole (writing and art). This is contradicted by credits from the Spirit Index by Cat Yronwode printed throughout the Kitchen Sink Spirit magazine run. Credits in GDC series remain as per Yronwode index but reconciliation is needed.",
	  NULL,NULL,NULL,NULL,NULL,NULL
	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
	  89503,"2",9914,631,1980,
	  "5.95 USD",68.000,NULL,"At least two printings exist; 2nd printing has 1978 and 1980 copyright dates in indicia. According to Eisner's introduction in the 1st [nn] volume 1st 6 weeks of dailies were written by Eisner with art by Lou Fine over Eisner layouts; rest of strips for the daily run through 1944 were by Jack Cole (writing and art). This is contradicted by credits from the Spirit Index by Cat Yronwode printed throughout the Kitchen Sink Spirit magazine run. Credits in GDC series remain as per Yronwode index but reconciliation is needed.",
	  NULL,NULL,NULL,NULL,NULL,NULL
	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
	  89504,"3",9914,631,1980,
	  "5.95 USD",68.000,NULL,"Cover is the same as issue #2 but the background is yellow instead of blue. According to Eisner's introduction the 1st [nn] volume 1st 6 weeks of dailies were written by Eisner with art by Lou Fine over Eisner layouts; rest of strips for the daily run through 1944 were by Jack Cole (writing and art). This is contradicted by credits from the Spirit Index by Cat Yronwode printed throughout the Kitchen Sink Spirit magazine run. Credits in GDC series remain as per Yronwode index but reconciliation is needed.",
	  NULL,NULL,NULL,NULL,NULL,NULL
	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
	  89505,"4",9914,631,1980,
	  "6.95 USD",76.000,NULL,"According to Eisner's introduction the 1st [nn] volume 1st 6 weeks of dailies were written by Eisner with art by Lou Fine over Eisner layouts; rest of strips for the daily run through 1944 were by Jack Cole (writing and art). This is contradicted by credits from the Spirit Index by Cat Yronwode printed throughout the Kitchen Sink Spirit magazine run and also by the Yronwode essay on the back cover of issue #4 of this series where Cole is credited with writing his own stories while Fine is said to have illustrated Bill Woolfolk stories. Credits in GDC series remain as per Yronwode index but reconciliation is needed.",
	  NULL,NULL,NULL,NULL,NULL,NULL
	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
