	  89515,NULL,9916,4355,1982,
	  "1.50 USD; 2.00 CAD",52.000,NULL,"This magazine is the second in a series of publications (\"... Chronicles\") spotlighting popular comic series. It contains primarily text features articles and checklists. Additional issues include #3 The Daredevil Chronicles #4 Avengers Chronicles # 5 Spider-Man Chronicles.Contents for this issue include:\"Twenty Years with the World's Greatest Comic Magazine\" by J.A. Fludd (Text)\"Will the Real Fantastic Four Annual #1 Please Stand Up?\" by Fred G. Hembeck (Graphic)\"Questions and Answers With Jack Kirby Version Two\" by Roger Green (Text)\"Things Ain't What They Could Have Been Ben\" by Fred G. Hembeck (Graphic) \"After the Wedding: Ambiguity and an Expanding Universe\" by Steve Webb (Text)\"Interview: Marv Wolfman and Len Wein\" by Jay Zilber (Text)\"The Fantastic Four: A Personal Recollection\" by John Byrne (Text)\"The Fantastic Four Checklist\" by Rocco Nigro (Text)\"In Final Defeat\" by Don Martinec (Graphic)\"Chronic Comments\" (fan letters to the editor) (text)",
